import React from 'react';

class Header extends React.Component {

	render() {
		return (
			<div className="Header">
				{Object.keys(this.props.pages).map(page => (
					<button key={page} onClick={console.log('ololo')}>
						{page}
					</button>
				))}
			</div>
		);
	}

}

export default Header;
